import libnum
import gmpy2
import uuid
import random

p = libnum.generate_prime(1024)
q = libnum.generate_prime(1024)
flag = "flag{" + str(uuid.uuid4()) + "}"
n = p * q
phi = (p - 1) * (q - 1)
while True:
    e = random.randint(10000, 65537)
    if gmpy2.gcd(e, phi) == 1:
        break
d = libnum.invmod(e, phi)
c = libnum.s2n(flag)
m = pow(c, d, n)
print("p=", p)
print("q=", q)
print("m=", m)
print("d=", d)
print("n=", n)
